import React, { Component } from 'react'
import Layout from '../components/layout.js'
import Index from './tv_rss/tv_rss.js'

class Tvpage extends React.Component {
    render() {
        return (
            <Layout>
                <div className="Index">
                    <Index />
                </div>
            </Layout>
        )
    }
}

export default Tvpage;
